import React from "react";

const Form = () => {
	return (
		<React.Fragment>
			<form>
				<input className="enter-task" type='text' placeholder='Enter task' />
				<button>

            <i class='fa fa-plus-square' aria-hidden='true'></i>
            </button>
			</form>
		</React.Fragment>
	);
};

export default Form;
